    2011-13",nt"tracking_summary": {ntt"total": 12,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-03-18T00:13:32.615477",nt"name":
    "hydrographic-surveys-of-the-missouri-river-at-ponca-backwater-2011-13fced1",nt"isopen":
    false,nt"url": null,nt"notes": "An Innerspace 456 single-beam echosounder
    in conjunction with a Trimbleu00c2u00ae differential Global Positioning System (DGPS)
    and HYPACKu00c2u00ae navigation software, and Ashtech Z-Xtreme and Trimbleu00c2u00ae
    R8 GNSS receivers was used to survey 7 chutes and 3 backwaters on the Missouri River
    yearly from 2011-13. These chutes and backwaters are located on the Missouri River
    between Newcastle, Nebraska and Rulo, Nebraska in the States of Nebr., Iowa, and
    Mo. Surveys of chutes consisted of topographic and bathymetric data collected along
    transects spaced 30.48 m apart from high bank to high bank. Surveys of backwaters
    consisted of topographic and bathymetric data collected along a transect grid of
    76.2 m spacing. The format of this data is point data. The data were collected by
    the U.S. Geological Survey in cooperation with the U.S. Army Corps of Engineers
    Omaha District as part of the Missouri River Habitat Assessment and Monitoring Program.",nt"license_title":
